    false,nt"url": null,nt"notes": "This document describes the plan for managing
    waters on Tewaukon National Wildlfie Refuge for calendar year 1964.  Water use data
    for the year 1963 is included in the plan for the following sites: Lake Tewaukon,
    Cutler Marsh, White Lake and Clouds Lake.  The proposed plan begins with a summary
    of the 1963 water program, which reviews general information, food supplies, waterfowl
    use and vegetation control.  The water management section explains proposed management
    actions for the year 1965 at each water gage site.  This document also includes
    a letter of confirmation for approval of the plan and a memorandum with comments
    from the regional engineer.  A map is attached indicating the location of water
    gages.  A letter concerning a water rights litigation is also in this file.",nt"license_title":
